import React from "react";
import styles from './newCard.module.css'

const NewCard = (props) => {
  return (
    <div className={styles.wrapper} onClick={() => props.onConfirm(props)}>
        <h1>Add new card</h1>

    </div>
  );
};

export default NewCard;
